import React from 'react';
import { Link } from "react-router-dom";

const Navbar = () => {
  return (
    <div>
        <Link to="/">Main</Link>
        <Link to="/ReactPage">React</Link>
        <Link to="/MernPage">Mern</Link>
    </div>
  )
}

export default Navbar
